import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // 3. Get initial quantity and total
    const initialQuantity = await page.locator('.cart-item .quantity').textContent();
    const initialTotal = await page.locator('#cartTotal').textContent();

    // 4. Increase the quantity of the item
    await page.waitForSelector('.cart-item .quantity-btn', { timeout: 5000 });
    // The '+' button is the second button with this class in the item
    await page.locator('.cart-item .quantity-btn').nth(1).click();

    // Wait for the quantity to update (Playwright's auto-wait should handle this, but an explicit wait can be more robust)
    await page.waitForFunction(
      (expected) => document.querySelector('.cart-item .quantity')?.textContent.trim() === expected,
      '2',
      { timeout: 5000 }
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // 5. Extract the updated data
    const updatedQuantity = await page.locator('.cart-item .quantity').textContent();
    const updatedTotal = await page.locator('#cartTotal').textContent();

    return {
      success: true,
      action: "Successfully updated the quantity of an item in the cart.",
      extractedData: {
        initialQuantity: initialQuantity.trim(),
        initialTotal: initialTotal.trim(),
        updatedQuantity: updatedQuantity.trim(),
        updatedTotal: updatedTotal.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
